import React from 'react';
// import Card from './Card';

const App = () => {
  const numbers = [1, 4, 6, 8, 45, 89];
  return (
    <>
      <ul>{<li>{numbers.map((number) => number + 1)}</li>}</ul>
    </>
  );
};
export default App;
